    let a = useCallback(async ()=>{
        let data = await fetch("/socket",{
            method:"GET",
        })
        socket.emit('chat',{
            message:"this is the message",

        })
        console.log("data::",data.body)
    },[])


    return(
        <div>
            <input />
            <button onClick={a} >click</button>
        </div>
    )
}
export default React.memo(ChatAppForm)
